import React from "react";
import NavbarItem from "./NavbarItem";

const Navbar = () => {
  return (
    <div>
      <NavbarItem onTo="/top-artists" title="Top Artists" className="bg-blue-500"></NavbarItem>
      <NavbarItem onTo="/top-tracks" title="Top Tracks"></NavbarItem>
      <NavbarItem onTo="/recent" title="Recent"></NavbarItem>
      <NavbarItem onTo="/explore" title="Explore"></NavbarItem>
    </div>
  );
};

export default Navbar;
